import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import Header from '../components/Header';
import Footer from '../components/Footer';

function Favorites() {
    // Mock favorites data
    const [favorites, setFavorites] = useState([
        {
            id: 1,
            name: "Central Plaza Parking",
            address: "123 Main St, Downtown",
            price: "5.00",
            rating: 4.5,
            totalReviews: 128,
            distance: "0.5",
            lastUsed: "2025-02-20"
        },
        {
            id: 2,
            name: "City Mall Parking",
            address: "456 Market St, Uptown",
            price: "4.50",
            rating: 4.2,
            totalReviews: 96,
            distance: "0.8",
            lastUsed: "2025-02-15"
        }
    ]);

    const handleRemoveFavorite = (id) => {
        setFavorites(favorites.filter(favorite => favorite.id !== id));
    };

    const formatDate = (dateString) => {
        const date = new Date(dateString);
        return date.toLocaleDateString('en-US', {
            month: 'short',
            day: 'numeric',
            year: 'numeric'
        });
    };

    return (
        <div className="page-container">
            <Header />
            <div className="content-container">
                <div className="favorites">
                    <div className="section-header">
                        <h1>Favorite Parking Spots</h1>
                    </div>

                    <div className="favorites-grid">
                        {favorites.map(spot => (
                            <div key={spot.id} className="favorite-card">
                                <div className="favorite-header">
                                    <div className="favorite-info">
                                        <h3>{spot.name}</h3>
                                        <p className="address">{spot.address}</p>
                                    </div>
                                    <button 
                                        className="icon-button"
                                        onClick={() => handleRemoveFavorite(spot.id)}
                                        title="Remove from favorites"
                                    >
                                        ❤️
                                    </button>
                                </div>

                                <div className="favorite-details">
                                    <div className="detail-item">
                                        <span className="label">Price</span>
                                        <span className="value">${spot.price}/hr</span>
                                    </div>
                                    <div className="detail-item">
                                        <span className="label">Rating</span>
                                        <span className="value">
                                            <span className="stars">★</span> {spot.rating}
                                            <span className="reviews">({spot.totalReviews})</span>
                                        </span>
                                    </div>
                                    <div className="detail-item">
                                        <span className="label">Distance</span>
                                        <span className="value">{spot.distance} mi</span>
                                    </div>
                                    <div className="detail-item">
                                        <span className="label">Last Used</span>
                                        <span className="value">{formatDate(spot.lastUsed)}</span>
                                    </div>
                                </div>

                                <div className="favorite-actions">
                                    <Link to={`/parking/${spot.id}`} className="secondary-button">
                                        View Details
                                    </Link>
                                    <Link to={`/booking?spot=${spot.id}`} className="primary-button">
                                        Book Now
                                    </Link>
                                </div>
                            </div>
                        ))}

                        {favorites.length === 0 && (
                            <div className="empty-state">
                                <div className="empty-icon">❤️</div>
                                <h3>No favorite spots yet</h3>
                                <p>Save your favorite parking spots for quick access.</p>
                                <Link to="/search" className="primary-button">
                                    Find Parking
                                </Link>
                            </div>
                        )}
                    </div>
                </div>
            </div>
            <Footer />
        </div>
    );
}

export default Favorites;
